{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/cemprondanziel/google-data-analytics-case-study-1-cyclistic?scriptVersionId=122795783\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"b3aef0fa","metadata":{"papermill":{"duration":0.011899,"end_time":"2023-03-20T16:23:47.004768","exception":false,"start_time":"2023-03-20T16:23:46.992869","status":"completed"},"tags":[]},"source":["# Case Study 1\n","## Case Study: How Does a Bike-Share Navigate Speedy Success?\n","\n","\n","### Danziel Cempron\n","### 17/03/2023\n","\n","In this case study I play my role as a Junior Data Analyst. This is my first ever Kaggle Notebook. I'm not yet familiar with Kaggle so please bear with me.\n","\n","\n","# Background\n","\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geo-tracked and locked into a network of 692 stations across Chicago.\n","\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","\n","# Case study (ASK)\n","\n","This report will examine the business question: 'what is the most effective marketing strategy to converting Cyclistic’s casual riders to annul memberships?'\n","\n","It is understood that the goal can be broken down into 3 main questions.\n","\n"," 1. How do annual members and casual riders use Cyclistic bikes differently? \n"," 2. Why would casual riders buy Cyclistic annual memberships? \n"," 3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","\n","This report will seek to deliver on the following objectives:\n","\n","**How do annual members and casual riders use Cyclistic bikes differently?**\n","\n","\n","# Stakeholders\n","\n","This report also seeks to identify the important stakeholders that are involved in the overall analysis. This includes: \n","- Cyclistic Users, \n","- Director of Marketing,\n","- Cyclistic Marketing Team\n","- Cyclistic Executive Team\n","\n","\n","# Data sources (PREPARE)\n","\n","User data from the past 12 months, March 2023 - February 2023 has been made available. Each data set is in csv format and details every ride logged by Cyclistic customers. This data has been made publicly available via [license](https://ride.divvybikes.com/data-license-agreement) by Motivate International Inc. and the city of Chicago available [here](https://divvy-tripdata.s3.amazonaws.com/index.html). All user’s personal data has been scrubbed for privacy.\n","\n","## Preparation of Data "]},{"cell_type":"code","execution_count":1,"id":"d5fd26ea","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2023-03-20T16:23:47.030396Z","iopub.status.busy":"2023-03-20T16:23:47.027791Z","iopub.status.idle":"2023-03-20T16:23:48.585322Z","shell.execute_reply":"2023-03-20T16:23:48.582882Z"},"papermill":{"duration":1.573426,"end_time":"2023-03-20T16:23:48.588492","exception":false,"start_time":"2023-03-20T16:23:47.015066","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u00